import * as React from "react";
import { styled, useTheme } from "@mui/material/styles";
import Paper from "@mui/material/Paper";
import Divider from "@mui/material/Divider";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import MainBanner from "./components/MainBanner";
import RecentPosts from "./components/RecentPosts";
import Link from "@mui/material/Link";
import Box from "@mui/material/Box";
import AwesomeSlider from "react-awesome-slider";
import "react-awesome-slider/dist/styles.css";
import CSSLogo from "./assets/devlogos/css.png";

export default function Home() {
  const slider = (
    <AwesomeSlider>
      <div>{CSSLogo}</div>
      <div>2</div>
      <div>3</div>
      <div>4</div>
    </AwesomeSlider>
  );
  return (
    <>
      <Box sx={{ width: "90%", margin: "auto" }}>
        <Typography mb="25px" variant="h3">
          Are you in need of a Web Developer?
        </Typography>
        <Typography variant="h4">I believe I can help.</Typography>
        <Box sx={{ m: "5px" }}>
          <Typography variant="subtitle">
            I recently completed a 6 month course building websites, web apps,
            databses, and so much more. My github portfolio showcases all the
            projects and homeworks I completed in that time.
          </Typography>
        </Box>
        <Box>{slider}</Box>

        <Button
          href="https://github.com/gannacon"
          target="blank"
          sx={{ m: "10px" }}
          variant="contained"
          size="large"
        >
          GitHub
        </Button>

        <Button
          href="https://www.gannaway.org/"
          target="blank"
          sx={{ m: "10px" }}
          variant="contained"
          size="large"
        >
          Let's get to work
        </Button>
      </Box>
      <RecentPosts />
    </>
  );
}
